import React, {Component} from 'react';
import {Container, Col} from 'react-bootstrap';

class Footer extends Component {
    render(){
        return(
            <Container className="mt-5">
                <Col className="text-center">
                    <h4>Footer</h4>
                </Col>
            </Container>
        )
    }
}

export default Footer;
